        for (int i = 0; i < l.size() - 2; i++) {
            int left = i + 1;
            int right = l.size() - 1;
            while (left < right) {
                long sum = l.get(i) + l.get(left) + l.get(right);
                if (sum == 0) {
                    return true;
                } else if (sum < 0) {
                    left++;
                } else {
                    right--;
                }
            }
        }
        return false;

